Description:
ზედა ნოტებია ლავანდა, პიტნა, კარდამონი, ბერგამოტი და არტემიზია;

შუა ნოტებია დარიჩინი, ფორთოხლის ყვავილი და ქინძი;

საბაზისო ნოტებია ვანილი, ტონკას ლობიო, ქარვა, სანდლის ხე და კედარი.

ზედა ნოტებია კალაბრიული ბერგამოტი და წიწაკა;

შუა ნოტებია სიჩუანის წიწაკა, ლავანდა, ვარდისფერი წიწაკა, ვეტივერი, პაჩული, გერანიუმი და ელემი;

საბაზისო ნოტებია ამბროქსანი, კედარი და ლაბდანუმი.

ზედა ნოტებია ატამი, ფორთოხალი, კარდამონი და ჰელიოტროპი;

შუა ნოტებია რომი, კონიაკი, დავანა და ჟასმინი;

საბაზისო ნოტებია ვანილი, ინდონეზიური პაჩულის ფოთოლი, ტონკას ლობიო, სანდლის ხე, ბენზოინი, ქაშმერანი, სტირაქსი, ლაბდანუმი და ვეტივერი.

ზედა ნოტია მწარე ნუში;

შუა ნოტებია ვანილი და ყვავილოვანი ნოტები;

საბაზისო ნოტებია ვანილი აბსოლუტი, ულტრავანილი, ტონკას ლობიო და სანდლის ხე.

ზედა ნოტებია ლავანდა და სალბი;

შუა ნოტებია ტყავი, მწარე ნუში, ვანილი და ბალისფერი;

საბაზისო ნოტებია ტყავი, ტონკას ლობიო, ქაშმერანი, თეთრი ხე და ქარვა.

ზედა ნოტებია დარიჩინი, აგარის ხე (უდი), საკმეველი, ზაფრანა, ჯავზი, მწვანე ვაშლი და თეთრი მსხალი;

შუა ნოტებია პაჩული და ჟასმინი;

საბაზისო ნოტებია თამბაქო, მადაგასკარის ვანილი, ქარვა, სანდლის ხე, გუაიაკის ხე, თეთრი მუშკი და ჰაიტის ვეტივერი.

Toy Boy by Moschino არის ხის პიკანტური მამაკაცის სუნამო.

ზედა ნოტებია ვარდისფერი წიწაკა, მსხალი, ინდონეზიური ჯავზი, ელემი და ბერგამოტი;

შუა ნოტებია ვარდი, მიხაკი, მაგნოლია და სელის;

